	public Carte(int carte) {
		switch (carte) {
		case 1:
			carte1();
			setcWidth(100);
			setcHeight(100);
		}
	}

	public void init() {
		for (int i = 0; i < carteC1.length; i++) {
			for (int j = 0; j < carteC1[i].length; j++) {
				
				Case c = (Case) factory.create(carteC1[i][j]);
				int[] pos = new int[2];
				pos[0] = j;
				pos[1] = i;
				c.setPos(pos);
				c.setCaseElement(i*100+j);
				carte.add(c);
			}
		}
		for (int i = 0; i < carteC2.length; i++) {
			for (int j = 0; j < carteC2[i].length; j++) {
				if (carteC2[i][j] != 0) {
					carte.remove(j + i * cWidth);
					Case c = (Case) factory.create(carteC2[i][j]);
					int[] pos = new int[2];
					pos[0] = j;
					pos[1] = i;
					c.setPos(pos);
					c.setCaseElement(i*100+j);
					carte.add(j + i * cWidth, c);
				}
			}
		}
	}

	private void carte1() {
		String[] temp = carte1C1.split(",");
		this.carteC1 = new int[100][100];
		for (int i = 0; i < carteC1.length; i++) {
			for (int j = 0; j < carteC1[i].length; j++) {
				carteC1[i][j] = Integer.parseInt(temp[j + i * carteC1.length]);
			}
		}

		temp = carte1C2.split(",");
		this.carteC2 = new int[100][100];
		for (int i = 0; i < carteC2.length; i++) {
			for (int j = 0; j < carteC2[i].length; j++) {
				carteC2[i][j] = Integer.parseInt(temp[j + i * carteC2.length]);
			}
		}
	}

	public void setFactory(ElementFactory factory) {
		this.factory = factory;
	}

	public ArrayList<Case> getCarte() {
		return carte;
	}

	public int getcHeight() {
		return cHeight;
	}

	public void setcHeight(int cHeight) {
		this.cHeight = cHeight;
	}

	public int getcWidth() {
		return cWidth;
	}

	public void setcWidth(int cWidth) {
		this.cWidth = cWidth;
	}

